  KEY `reservations_handed_over_by_user_id_fk` (`handed_over_by_user_id`),
  CONSTRAINT `reservations_handed_over_by_user_id_fk` FOREIGN KEY (`handed_over_by_user_id`) REFERENCES `users` (`id`),
